import React from 'react';
import myphoto from '../public/logo2.png'

const Home = () =>{
  return(
    <div class="row">

    <div class="jumbotron col-2">
      <img src={myphoto} height="70px" width="50px"/>
    </div>
    <div class="col-2"></div>
    </div>
  );
}

export default Home;
